import React, {Component} from 'react';

class GetWebsiteData extends Component {    
    state = {
        content: this.props.content
    };

    render () {
        return (
            <React.Fragment>
                <p>Preview</p>
            </React.Fragment>
        );
    }
}
export default GetWebsiteData;
